# 转换为秒
def duration_to_seconds(text):
    import re
    minute = second = 0
    m = re.search(r'(\d+)分', text)
    s = re.search(r'(\d+)秒', text)
    if m:
        minute = int(m.group(1))
    if s:
        second = int(s.group(1))
    return minute * 60 + second

